import filters from "./filters";
import products from "./products";
import images from "./images";
import categories from "./categories";
import reviews from "./reviews";
import checkout from "./checkout";

export default {
  filters: filters,
  products: products,
  images: images,
  categories: categories,
  reviews: reviews,
  checkout: checkout
};
